package com.last.pay.cache.mode;

public class TempPayInfo {
	
	private int toll;
	
	private int position;
	
	private float slotMultipler;
	
	private int gold;

	public int getToll() {
		return toll;
	}

	public void setToll(int toll) {
		this.toll = toll;
	}

	public int getPosition() {
		return position;
	}

	public void setPosition(int position) {
		this.position = position;
	}

	public float getSlotMultipler() {
		return slotMultipler;
	}

	public void setSlotMultipler(float slotMultipler) {
		this.slotMultipler = slotMultipler;
	}

	public int getGold() {
		return gold;
	}

	public void setGold(int gold) {
		this.gold = gold;
	}
	
	

}
